import React from "react";
import { Route, Redirect } from "react-router-dom";
import { useSelector, useDispatch } from "react-redux";
import { isLoggedIn } from "../../utils/helper";
import { userLoginProcess } from "../../actions/user";
import AuthNavbar from "../../components/Layouts/AuthNavbar";
import AuthFooter from "../../components/Layouts/AuthFooter";
const PrivateRoutes = ({ component: Component, ...rest }) => {
  const { isAuthenticated, isLoading } = useSelector(state => state.userLogin);
  //console.log("Login ",state)
  // return <Route {...rest} render={(props) => <Component {...props} />}/>
  return <Route {...rest} render={(props) => ((isLoggedIn() || isAuthenticated) ?  <><AuthNavbar /><Component {...props} /><AuthFooter/></> : <Redirect to="/login" />)} />;
};

export default PrivateRoutes;
